const SoftSkills = (props) => {

    const { skillName } = props;

    const circleStyle = {
        height: 150,
        width: 150,
        borderRadius: 100,
        backgroundColor: "var(--pale-pink)",
    }

    const textStyle = {
        color: "var(--beige)",
        height: 'inherit',
        width: '90%',
        paddingLeft: '5%',
        textAlign: 'center',
        display: 'flex',
        flexWrap: 'wrap',
        alignItems: 'center',
        justifyContent: 'center'
    }

    return (
        <div className="skill" style={circleStyle}>
            <p style={textStyle}>{`${skillName}`}</p>
        </div>
    )   
}

export default SoftSkills
